import { Box, Checkbox, TextField, Typography } from "@mui/material"
import Input from "./Input"
import ButtonCompo from "./button"
import "./Login.css"
import { FormEvent, FormEventHandler, useState } from "react"
import { loginDetails } from "../typescriptDatatype/dataType"

export default function Login() {

let [loginDetails,setLoginDetails]=useState<loginDetails>({EmailId:"",password:""})


// Login CX
const loginCoustomer=(event:FormEvent<HTMLFormElement>):void=>{
    event.preventDefault()

}

// input value
const inputLogin=(loginInput:string,LoginName:string)=>{



  setLoginDetails((prev)=>{
    return {...prev,[LoginName]:loginInput}
     })




}
console.log(loginDetails)
















  return (
    <>
      <Box component={"section"} sx={style.box}>
        <Box
          sx={{
            display: "flex",
            height: "70vh",
            mt: "10%",
            width: "70%",
            boxShadow: "0px 0px 16px 4px",
          }}
        >
          <Box sx={{ width: 500, mr: 2 }}>
            <div className="firstbox">
              <Typography
                variant={"h4"}
                style={{
                  margin: 4,
                  fontFamily: "Edu AU VIC WA NT Arrows ,cursive",
                  position: "relative",
                  top: "145px",
                  left: "75px",
                  fontSize: "55px",
                  width: "243px",
                }}
              >
                Tip /Mart
              </Typography>
            </div>
          </Box>
          <Box>
            <Typography
              sx={{
                position: "absolute",
                left: "77%",
                mt: 2,
                fontFamily: "Dancing Script, serif",
              }}
              variant="h5"
            >
              Sign-up
            </Typography>
            <Box component={"form"}
            onSubmit={loginCoustomer}


              sx={{
                display: "flex",
                justifyContent: "center",
                alignItems: "",
                height: "100%",
                flexDirection: "column",
              }}
            >
              <Input
                type="email"
                label="Email Id"
                style={{ mb: 1, width: 300 }}
                name="loginEmail"
                emailid={inputLogin}

              />
              <br></br>
              <Input
                type="password"
                label="Password"
                style={{ mt: 1, width: 300 }}
                emailid={inputLogin}
                name="loginPassword"

              />
              <br></br>
              <div
                style={{
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                }}
              >
                <Box
                  component={"div"}
                  sx={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                  }}
                >
                  {" "}
                  <Checkbox></Checkbox>
                  <Box component={"span"} sx={{ fontSize: "15px" }}>
                    Remember
                  </Box>
                </Box>

                <Box>
                  {" "}
                  <Box component={"span"} sx={{ fontSize: "15px", mb: 2 }}>
                    forgot password ?
                  </Box>
                </Box>
              </div>
              <ButtonCompo
                text={"Login"}
                variant1="contained"
                style={{ mt: 0, width: 100 }}
                type="submit"
              ></ButtonCompo>
            </Box>
          </Box>
        </Box>
      </Box>
    </>
  )
}

const style = {
  box: {
    display: "flex",
    justifyContent: "center",
    height: "70vh",
    alignItems: "center",
  },
}
